import React, { useEffect, useRef, useState } from 'react';
import './Home.css';

function Home() {
  const aboutRef = useRef(null);
  const [visible, setVisible] = useState(false);

  useEffect(() => {
    function handleScroll() {
      if (!aboutRef.current) return;
      const rect = aboutRef.current.getBoundingClientRect();
      if (rect.top < window.innerHeight * 0.8) {
        setVisible(true);
      }
    }

    window.addEventListener('scroll', handleScroll);
    handleScroll(); // initial check

    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <div className="home-container">

      {/* Hero Section */}
     {/* Main About Section */}
<section
  id="about"
  className={`section about-main ${visible ? 'visible' : ''}`}
  ref={aboutRef}
>
  <div className="about-left">
    <h2>A Solana based NFT-Driven Lending Solution</h2>
    <h3>Check Your Eligibility</h3>
    <input
      type="text"
      placeholder="Enter your Solana Wallet Id"
      className="demo-input"
    />
    <button className="check-btn">Submit</button>
  </div>

  <div className="about-right">
    <h2>All Your NFT Holdings</h2>
    <div className="media-boxes">
      <div className="media-box image-box">Image</div>
      <div className="media-box video-box">Video</div>
      <div className="media-box audio-box">Audio</div>
    </div>
  </div>
</section>

{/* Secondary About Section */}
<section id="about-2" className="section about-secondary">
  <div className="about-2-left">
    <div className="background-container">
      <h2>Check Eligibility</h2>
      <p>Enter your wallet to see if you qualify instantly!</p>
      <input
        type="text"
        placeholder="Enter your Solana Wallet Id"
        className="demo-input"
      />
      <button className="check-btn">Check Now</button>
    </div>
  </div>
  <div className="about-2-right">
    <h2>Why Choose LoanChain?</h2>
    <p>
      Our solution leverages NFTs on Solana to provide quick, secure, and decentralized loans.
    </p>
  </div>
</section>


      {/* About / Demo Section */}
      <section
  id="about"
  className={`section about-section ${visible ? 'visible' : ''}`}
  ref={aboutRef}
>
  <h2>A Solana based NFT-Driven Lending Solution</h2>
  <h3>Check Your Eligibility</h3>
  <input
    type="text"
    placeholder="Enter your Solana Wallet Id"
    className="demo-input"
  />
  <button className="check-btn">Submit</button>
</section>



      {/* Features Section */}
      <section id="features" className="section features-section">
        <h2>Features</h2>
        <ul>
          <li>Decentralized loan agreements</li>
          <li>Instant loan verification</li>
          <li>Secure NFT-backed collateral</li>
          <li>Transparent repayment schedules</li>
        </ul>
      </section>

    </div>
  );
}

export default Home;
